// --- PEGANDO VARI√ÅVEIS DIRETAMENTE DO NODE 'Supabase19' ---
// Tentamos pegar as vari√°veis de forma segura. Se o n√≥ Supabase19 n√£o tiver esses campos,
// eles ser√£o undefined, e as convers√µes/valida√ß√µes abaixo lidar√£o com isso.
const itemSupabase = $('Supabase19').first().json;

// Extra√ß√£o e convers√£o de valores para n√∫meros.
// Number() tentar√° converter e retornar√° NaN se n√£o for um n√∫mero v√°lido.
const peso = Number(itemSupabase.peso);
const altura = Number(itemSupabase.altura);
const idade = Number(itemSupabase.idade);

// Vari√°veis que podem ser strings. Usamos || "" para garantir que sejam strings vazias se undefined.
// .toLowerCase() para padronizar as entradas.
const sexo = (itemSupabase.sexo || "").toLowerCase();
const objetivo = 'emagrecer';

// parseInt() para n√≠vel de atividade. Usamos 10 para base decimal.
// Se n√£o for um n√∫mero v√°lido, ser√° NaN, o que ser√° tratado na valida√ß√£o.
const nivelAtividadeInput = parseInt(itemSupabase.nivel_atividade, 10);
let nivelAtividade = 2; // Valor padr√£o caso a entrada seja inv√°lida ou fora da faixa

// --- VALIDA√á√ÉO DE ENTRADAS CR√çTICAS ---
// Retorna um erro se qualquer dado essencial for inv√°lido.

// 1. Valida√ß√£o de peso, altura, idade
if (isNaN(peso) || peso <= 0 ||
    isNaN(altura) || altura <= 0 ||
    isNaN(idade) || idade <= 0) {
  return [
    {
      json: {
        erro: "Erro: Peso, altura ou idade inv√°lidos. Certifique-se de que s√£o n√∫meros positivos."
      }
    }
  ];
}

// 2. Valida√ß√£o de sexo
if (sexo !== "masculino" && sexo !== "feminino") {
  return [
    {
      json: {
        erro: "Erro: Sexo inv√°lido. Use 'masculino' ou 'feminino'."
      }
    }
  ];
}

// 3. Valida√ß√£o de objetivo
// Adicionando um array de objetivos v√°lidos para valida√ß√£o mais robusta
const objetivosValidos = ["emagrecer", "manter", "ganhar"];
if (!objetivosValidos.includes(objetivo)) {
  return [
    {
      json: {
        erro: `Erro: Objetivo inv√°lido. Use um dos seguintes: ${objetivosValidos.join(', ')}.`
      }
    }
  ];
}

// 4. Valida√ß√£o e ajuste de N√≠vel de Atividade
// Se o n√≠vel de atividade do input for um n√∫mero v√°lido e dentro da faixa, use-o.
// Caso contr√°rio, o 'nivelAtividade' j√° est√° definido como 2 (padr√£o).
if (!isNaN(nivelAtividadeInput) && nivelAtividadeInput >= 1 && nivelAtividadeInput <= 5) {
  nivelAtividade = nivelAtividadeInput;
} else {
    // Podemos retornar um aviso aqui ou apenas usar o padr√£o sem erro fatal
    // console.warn("Aviso: N√≠vel de atividade inv√°lido. Usando o valor padr√£o (2 - atividade leve).");
}

// --- FATORES DE ATIVIDADE (PARA C√ÅLCULO DO GET) ---
const fatoresAtividade = {
  1: 1.2,    // Sedent√°rio
  2: 1.375,  // Levemente Ativo (1-3 dias/semana)
  3: 1.55,   // Moderadamente Ativo (3-5 dias/semana)
  4: 1.725,  // Muito Ativo (6-7 dias/semana)
  5: 1.9     // Extremamente Ativo (Atletas, 2x ao dia)
};

// --- C√ÅLCULO DA TMB (TAXA METAB√ìLICA BASAL) ---
let tmb = 0;
if (sexo === "masculino") {
  tmb = (10 * peso) + (6.25 * altura) - (5 * idade) + 5;
} else { // sexo === "feminino" (j√° validado)
  tmb = (10 * peso) + (6.25 * altura) - (5 * idade) - 161;
}

// --- C√ÅLCULO DO GET (GASTO ENERG√âTICO TOTAL) ---
// Usa o fator de atividade correspondente, ou 1.2 (sedent√°rio) como fallback.
const fatorAtividadeAplicado = fatoresAtividade[nivelAtividade] || 1.2;
let calorias = tmb * fatorAtividadeAplicado;

// --- AJUSTE DE CALORIAS PELO OBJETIVO ---
if (objetivo === "emagrecer") {
  calorias *= 0.8; // Reduz em 20%
} else if (objetivo === "ganhar") {
  calorias *= 1.15; // Aumenta em 15%
}
calorias = Math.round(calorias); // Arredonda para o n√∫mero inteiro mais pr√≥ximo

// --- C√ÅLCULO DOS MACRONUTRIENTES ---
let proteinaPorKg = 2.0; // Padr√£o
let gorduraPorKg = 0.8;  // Padr√£o

if (objetivo === "emagrecer") {
  proteinaPorKg = 2.2; // Maior para emagrecimento
  gorduraPorKg = 0.7;  // Menor para emagrecimento
} else if (objetivo === "ganhar") {
  proteinaPorKg = 2.0; // Mant√©m
  gorduraPorKg = 1.0;  // Um pouco mais para ganho
}

const proteinas = Math.round(proteinaPorKg * peso);
const kcalProteinas = proteinas * 4; // 1g Prote√≠na = 4 kcal

const gorduras = Math.round(gorduraPorKg * peso);
const kcalGorduras = gorduras * 9; // 1g Gordura = 9 kcal

// Carboidratos preenchem o restante das calorias
const kcalRestantesParaCarboidratos = calorias - (kcalProteinas + kcalGorduras);
// Garante que carboidratos n√£o sejam negativos
const carboidratos = Math.max(0, Math.round(kcalRestantesParaCarboidratos / 4)); // 1g Carboidrato = 4 kcal

// --- RETORNO DOS RESULTADOS ---
// O N8N espera um array de objetos, onde cada objeto tem uma propriedade 'json'.
return [
  {
    json: {
      peso,
      altura,
      idade,
      sexo,
      objetivo,
      nivelAtividade, // N√≠vel de atividade final (pode ser o padr√£o 2)
      tmb: Math.round(tmb), // Arredonda TMB para facilitar a leitura
      fatorAtividadeAplicado, // O fator usado para o c√°lculo do GET
      calorias, // Este √© o GET final ajustado
      proteinas,
      carboidratos,
      gorduras,
      // Opcional: retornar as calorias de cada macronutriente para verifica√ß√£o
      kcalProteinas,
      kcalGorduras,
      kcalCarboidratos: carboidratos * 4 // Calorias dos carboidratos
    }
  }
];
